webpackJsonp([0xf4d2f742b7db],{1316:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2013-01-16-pearl-harbor/index.md absPath of file >>> MarkdownRemark",html:'<p>Sunday we visited Pearl Harbor. It&apos;s a sobering place. Of course I&apos;ve spent my life learning about the history, but a visit is very touching and helps remind you of the cost of the freedoms we take for granted.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-ddadf.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 6188" title="" src="/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-b80fa.jpg" srcset="/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-cf410.jpg 163w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-62f2a.jpg 325w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-b80fa.jpg 650w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-08cb4.jpg 975w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-f2bf9.jpg 1300w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-fd4ba.jpg 1950w,\n/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-ddadf.jpg 4320w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Tears of the Arizona. About 500,000 gallons of oil remain.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-ddadf.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 62031" title="" src="/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-b80fa.jpg" srcset="/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-cf410.jpg 163w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-62f2a.jpg 325w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-b80fa.jpg 650w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-08cb4.jpg 975w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-f2bf9.jpg 1300w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-fd4ba.jpg 1950w,\n/static/IMG_62031-ee2f4e1aaa77ea574d3b3bd2669a65cb-ddadf.jpg 4320w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Parts of the Arizona remain above the water.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-ddadf.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 6202" title="" src="/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-b80fa.jpg" srcset="/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-cf410.jpg 163w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-62f2a.jpg 325w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-b80fa.jpg 650w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-08cb4.jpg 975w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-f2bf9.jpg 1300w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-fd4ba.jpg 1950w,\n/static/IMG_6202-8cb4f75e05ae50b85abd1e7a31e6560d-ddadf.jpg 4320w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>The Missouri</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-ddadf.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 6199" title="" src="/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-b80fa.jpg" srcset="/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-cf410.jpg 163w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-62f2a.jpg 325w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-b80fa.jpg 650w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-08cb4.jpg 975w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-f2bf9.jpg 1300w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-fd4ba.jpg 1950w,\n/static/IMG_6199-42a85100b3b6393c64ed7f2cc0ef9b30-ddadf.jpg 4320w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>A Japanese torpedo they found while dredging the bay (unexploaded). They examined it, then detonated it. Here&apos;s what remains:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1644" title="" src="/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-b80fa.jpg" srcset="/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-cf410.jpg 163w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-62f2a.jpg 325w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-b80fa.jpg 650w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-08cb4.jpg 975w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-f2bf9.jpg 1300w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-fd4ba.jpg 1950w,\n/static/IMG_1644-4164610a53cb9b26a04cda73bded682c-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>We spent the evening along the shore in Ko Olina.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1653-c54a9c522fc7ce343037bee114904863-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1653" title="" src="/static/IMG_1653-c54a9c522fc7ce343037bee114904863-b80fa.jpg" srcset="/static/IMG_1653-c54a9c522fc7ce343037bee114904863-cf410.jpg 163w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-62f2a.jpg 325w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-b80fa.jpg 650w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-08cb4.jpg 975w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-f2bf9.jpg 1300w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-fd4ba.jpg 1950w,\n/static/IMG_1653-c54a9c522fc7ce343037bee114904863-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>We&apos;re pretty happy to be here.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-f148f.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1646" title="" src="/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-b80fa.jpg" srcset="/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-cf410.jpg 163w,\n/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-62f2a.jpg 325w,\n/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-b80fa.jpg 650w,\n/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-08cb4.jpg 975w,\n/static/IMG_1646-6f544d71b3771134045547d6f2b0d4f8-f148f.jpg 1280w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    ',frontmatter:{title:"Pearl Harbor",date:"January 16, 2013",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/IMG_6188-3a6bfc0e504e5f2e96aa112c7ca02b73-381d6.jpg"}}}}}},pathContext:{path:"/pearl-harbor"}}}});
